import React, { Component, Fragment } from 'react'
import Header from '../../components/Header'
import './profile.css'

export default class Profile extends Component {
  render() {
    return (
      <Fragment>
        <Header/>
        <div className='hover:bg-black  hover:text-white text-red-600 cursor-pointer text-9xl font-bold text-left drop-shadow-2xl  bg-white p-4 rounded-t-3xl md:text-center m-10'>Profile</div>
      </Fragment>
    );
  }
}
